import React from 'react'

import face1 from '../../../images/face/face1.svg';
import face2 from '../../../images/face/face2.svg';
import face3 from '../../../images/face/face3.svg';
import face4 from '../../../images/face/face4.svg';
import face5 from '../../../images/face/face5.svg';
import face6 from '../../../images/face/face6.svg';
import face7 from '../../../images/face/face7.svg';
import face8 from '../../../images/face/face8.svg';

const RightElementFace = () => {
    return (
        <div className="right_element element-face">
            <img className="right_image" id="element_4" src={face1} alt="face1"></img>
            <img className="right_image" id="element_5" src={face2} alt="face2"></img>
            <img className="right_image" id="element_6" src={face3} alt="face3"></img>
            <img className="right_image" id="element_7" src={face4} alt="face4"></img>
            <img className="right_image" id="element_8" src={face5} alt="face5"></img>
            <img className="right_image" id="element_9" src={face6} alt="face6"></img>
            <img className="right_image" id="element_10" src={face7} alt="face7"></img>
            <img className="right_image" id="element_11" src={face8} alt="face8"></img>
        </div>
    )
}

export default RightElementFace
